import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { TextField } from '@mui/material';

// SelectLabelsDouble component with date handling
export function SelectLabelsDouble() {
  const [roomType, setRoomType] = React.useState('');
  const [checkInDate, setCheckInDate] = React.useState(null);
  const [checkOutDate, setCheckOutDate] = React.useState(null);
  const [guests] = React.useState(2); // Automatically set to 2 for double rooms
  const [error, setError] = React.useState(false);

  // Handle room type change
  const handleRoomChange = (event) => {
    setRoomType(event.target.value);
    setError(false); // Reset error message when room type changes
  };

  // Handle check-in date change
  const handleCheckInDateChange = (newDate) => {
    setCheckInDate(newDate);
  };

  // Handle check-out date change
  const handleCheckOutDateChange = (newDate) => {
    setCheckOutDate(newDate);
  };

  // Handle submit button click
  const handleSubmit = async () => {
    // Check for missing data
    if (!roomType || !checkInDate || !checkOutDate) {
      setError(true);
      alert("Please complete all fields");
      return;
    }

    // Send all the data to the backend
    const requestBody = {
      roomType,
      checkInDate: checkInDate.toISOString(),
      checkOutDate: checkOutDate.toISOString(),
      guests,
    };

    try {
      const response = await fetch("http://localhost:5000/api/booking/details", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(requestBody),
      });

      const data = await response.json();
      if (response.ok) {
        console.log("Booking details submitted successfully:", data);
        alert("Booking details submitted successfully!");
      } else {
        alert(data.message || 'Failed to submit booking details');
      }
    } catch (error) {
      console.error("Error:", error.message);
      alert(error.message || 'Failed to submit booking details');
    }
  };

  return (
    <Box>
      <FormControl sx={{ m: 1, minWidth: 400 }}>
        <InputLabel id="room-type-label">Room Type</InputLabel>
        <Select
          labelId="room-type-label"
          id="room-type-select"
          value={roomType}
          label="Room Type"
          onChange={handleRoomChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value="doubleDuplex">Double Duplex Room</MenuItem>
          <MenuItem value="singleRoom">Single Room</MenuItem>
          <MenuItem value="suiteRoom">Suite Room</MenuItem>
        </Select>
        <FormHelperText>Choose your room type</FormHelperText>
      </FormControl>

      {/* Date Pickers */}
      <LocalizationProvider dateAdapter={AdapterDayjs}>
        <Box sx={{ paddingTop: 2 }}>
          <DatePicker
            label="Check-in Date"
            value={checkInDate}
            onChange={handleCheckInDateChange}
            renderInput={(params) => <TextField {...params} />}
          />

          <DatePicker
            label="Check-out Date"
            value={checkOutDate}
            onChange={handleCheckOutDateChange}
            renderInput={(params) => <TextField {...params} />}
          />
        </Box>
      </LocalizationProvider>

      <Button onClick={handleSubmit} variant="contained" color="primary" sx={{ marginTop: 2 }}>
        Submit Dates
      </Button>

      {error && <FormHelperText error>All fields are required!</FormHelperText>}
    </Box>
  );
}
